    [],nt"revision_timestamp": "2016-01-09T11:51:40.286422",nt"name": "national-bycatch-report-nbr",nt"isopen":
    false,nt"url": null,nt"notes": "This system collects bycatch data and fishery
    landings data from all five NOAA Fisheries Regions and automates the generation
    of the tables required to publish the National Bycatch Report (NBR).  The NBR documents
    bycatch estimates, using observer data and self-reported logbook data, for all fisheries
    for which this information is available.  NBR bycatch estimates are fishery- and
    species-specific.  The NBR includes bycatch estimates for fish, marine mammals,
    sea turtles, seabirds, and corals.  Future NBR reports will include additional bycatch
    estimates as new fisheries are monitored and new data are analyzed.  Over time,
    the NBR, along with other information sources, should help improve NOAA Fisheries'
    ability to monitor bycatch trends, improve stock assessments, and set fishery monitoring
    priorities, as well as serve as a useful data tool for NOAA Fisheries' management
    partners.",nt"license_title": null,nt"extras": [{ntt"key": "temporal-extent-begin",ntt"value":
